INSERT INTO `quote_template` (`id`, `code`, `header`, `footer`, `created_at`, `updated_at`) VALUES
(1, 'quote Contoh', '<p>Nomor&nbsp; &nbsp; &nbsp; &nbsp; : __QUOTE__&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; __DATE__<br />Lampiran&nbsp; &nbsp; : -</p>\r\n<p>Kepada Yth :<br />Up. __PIC__<br />__COMPANY__<br />__ADDRESS__<br />Tlp. __PHONE__</p>\r\n<p>&nbsp;</p>\r\n<p>Dengan Hormat :</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Berdasarkan informasi dan pembicaraan lebih lanjut antar pihak PT. Adika Jaya Dewata dengan pihak Bapak/Ibu. maka kami melampirkan surat penawaran resmi ini seperti permintaan barang yang telah disepakati dengan berikut rincian barang tersebut :</p>', '<ul>\r\n<li>Harga penawaran ini hanya berlaku selama 7 hari dari tanggal yg tertera di penawaran ini</li>\r\n<li>Uang tanda jadi minimal Rp.5.000.000,.untuk pengikat harga dan berlaku sampai 3 bulan</li>\r\n<li>Apabila lebih dari 3 bulan maka harga akan disesuaikan dengan harga terbaru</li>\r\n<li>Down Payment (DP) 50% barang akan kami siapkan dan dijadwalkan pengiriman</li>\r\n<li>Pelunasan setelah barang sampai dan dipasang oleh teknisi kami</li>\r\n<li>Apabila pengiriman dan pemasangan bukan dari agen automega maka pelunasan ketika barang sampai ekspedisi pengiriman</li>\r\n<li>Harga tidak mengikat dan dapat berubah sewaktu-waktu</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<h2>&nbsp; &nbsp; Harga paket peralatan diatas belum termasuk</h2>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Biaya pengiriman dari Jakarta - Lokasi<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Biaya akomodasi teknisi ( pesawat, taxy, bus,dll PP Jakarta &ndash;Tujuan )<br />&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;- Uang saku Rp.100.000/orang/hari &amp; tempat istirahat / hotel<br />&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;- Perlengkapan instalasi ( pipa, semen, kabel pasir dll yang merupakan kebutuhan instalasi ) Demikian surat penawaran ini kami sampaikan atas perhatian dan <br />&nbsp; &nbsp;kerjasamanya kami ucapkan terima kasih.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hormat Kami,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; __SALES__</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2019-01-03 12:56:56', '2019-01-03 13:56:56');
