(2, 'Term Quote 1', 'Term Quote 1', 'term-quote-1', '<h2>TERMS &amp; CONDITIONS OF QUOTATION</h2>\r\n<h5>BUYER&rsquo;S OFFER RESULTING FROM SELLER&rsquo;S QUOTATION IS EXPRESSLY CONDITIONED UPON BUYER&rsquo;S ASSENT TO SELLER&rsquo;S STANDARD TERMS AND CONDITIONS PRINTED BELOW. ALL ORDERS WILL BE SUBJECT TO ACCEPTANCE ON SELLER&rsquo;S STANDARD SALES ORDER ACKNOWLEDGEMENT FORM BY SELLER AT SELLER&rsquo;S APPROPRIATE ORDER ENTRY LOCATION.</h5>\r\n<h2>TERMS &amp; CONDITIONS OF SALE</h2>\r\n<h5>ACCEPTANCE OF BUYER&rsquo;S ORDER IS CONDITIONAL ON BUYER&rsquo;S ASSENT TO THE TERMS AND CONDITIONS PRINTED BELOW. IF BUYER OBJECTS TO ANY TERMS BELOW, SUCH OBJECTION MUST BE IN WRITING AND DELIVERED TO SELLER WITHIN A REASONABLE TIME, NOT TO EXCEED TEN (10) DAYS OF RECEIPT OF THIS DOCUMENT. FAILURE TO MAKE SUCH A TIMELY EXCEPTION, OR ACCEPTANCE BY BUYER OF ANY GOODS DELIVERED BY SELLER HEREUNDER, SHALL BE CONCLUSIVELY DEEMED ASSENT TO THE TERMS AND CONDITIONS BELOW. SELLER&rsquo;S FAILURE TO OBJECT TO PROVISIONS CONTAINED IN ANY COMMUNICATION FROM BUYER WILL NOT BE A WAIVER OF THE PROVISIONS HEREOF.</h5>', '2018-07-19 02:25:35', '2018-07-30 10:00:56');
